pragma solidity 0.6.12;

contract MyContract {
    address public admin;
    address public feeaccount;
    mapping(address => uint256) public feemake;
    mapping(address => uint256) public feetake;
    mapping(address => uint256) public feedeposit;
    mapping(address => uint256) public feewithdraw;
    mapping(address => mapping(address => uint256)) public balanceof;
    mapping(address => mapping(bytes32 => uint256)) public orders;
    mapping(address => mapping(bytes32 => uint256)) public orderfills;
    mapping(address => uint256) public testtrade;
    mapping(address => uint256) private s_10;
    mapping(address => uint256) public tokensminamountsell;

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

    function setTokenFeeWithdraw(address _token, uint256 _value) public onlyAdmin {
        feewithdraw[_token] = _value;
    }

    function setTokenMinAmountBuy(address _token, uint256 _value) public onlyAdmin {
        s_10[_token] = _value;
    }

    function setTokenFeeTake(address _token, uint256 _value) public onlyAdmin {
        feetake[_token] = _value;
    }

    function cancelOrder(address tokenBuy, uint256 amountBuy, address tokenSell, uint256 amountSell, uint256 nonce, uint256 expires, uint8 v, bytes32 r, bytes32 s) public {
        bytes32 orderHash = sha256(abi.encodePacked(address(this), tokenBuy, amountBuy, tokenSell, amountSell, nonce, expires));
        if (orders[msg.sender][orderHash] != 0) {
            orderfills[msg.sender][orderHash] = amountBuy;
        } else {
            address recoveredAddress = ecrecover(keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", orderHash)), v, r, s);
            if (recoveredAddress != address(0)) {
                orderfills[msg.sender][orderHash] = amountBuy;
            }
        }
    }

    function setTokenMinAmountSell(address _token, uint256 _value) public onlyAdmin {
        tokensminamountsell[_token] = _value;
    }

    function changeFeeAccount(address _feeaccount) public onlyAdmin {
        feeaccount = _feeaccount;
    }

    function changeAdmin(address _admin) public onlyAdmin {
        admin = _admin;
    }

    function setTokenFeeDeposit(address _token, uint256 _value) public onlyAdmin {
        feedeposit[_token] = _value;
    }

    function setTokenFeeMake(address _token, uint256 _value) public onlyAdmin {
        feemake[_token] = _value;
    }

    function withdraw(uint256 amount) public {
        require(balanceof[address(0)][msg.sender] >= amount);
        balanceof[address(0)][msg.sender] -= amount;
        (bool success,) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed.");
    }

    function depositToken(address token, uint256 amount) public {
        require(token != address(0));
        require(testtrade[token] != 0);
        balanceof[token][msg.sender] += amount;
        (bool success,) = token.call(abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, address(this), amount));
        require(success, "Transfer failed.");
    }

    function withdrawToken(address token, uint256 amount) public {
        require(token != address(0));
        require(balanceof[token][msg.sender] >= amount);
        balanceof[token][msg.sender] -= amount;
        (bool success,) = token.call(abi.encodeWithSignature("transfer(address,uint256)", msg.sender, amount));
        require(success, "Transfer failed.");
    }

    receive() external payable {
        balanceof[address(0)][msg.sender] += msg.value;
    }
}
